import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import Header from '../Components/Header';
import NavigationBar from '../Components/NavigationBar';
import Footer from '../Components/Footer';
import './HomePage.css';

const HomePage = () => {
  return (
    <div className="home-page">
      <Header />
      <NavigationBar />

      <div className="home-content">
        <section className="section section-1">
          <div className="container">
            <h2>Welcome to My Website</h2>
            <p>Explore our services and discover amazing features.</p>
            <a href="/services" className="btn btn-primary">Learn More</a>
          </div>
        </section>

        <section className="section section-2">
          <div className="container">
            <h2>Latest Updates</h2>
            <ul>
              <li>Notice 1: Your notice content here</li>
              <li>Notice 2: Your notice content here</li>
              <li>Notice 3: Your notice content here</li>
              {/* Add more notices as needed */}
            </ul>
          </div>
        </section>
      </div>

      <Footer />
    </div>
  );
}

export default HomePage;
